_DESCRIPTION_:
Pyronix Digi-GSM - внутренний  модем для радиоканальных контрольных панелей Enforcer WE и серии PCX.
Особенности Digi-GSM4-х диапазонный GSM / GPRS модем;
Передача тревожных извещений (например, Contact ID) по аналоговому каналу GSM на телефонный или GSM приемник (на ПЦН);
Передача тревожных извещений по GPRS каналу  на  ПЦН;
Передача тревожных SMS извещений. Сообщения руссифицированы;
Дистанционное программирование панелей по каналу GSM/GPRS;
Поддерживаются: Contact ID, Fast Format, SMS.
Передача SMS сообщений на мобильные телефоны пользователя;
Скорость 9600bps;
Возможность управления системой охраны Enforcer или панелями серии PCX;
Возможность подключения внешней GSM антенны (в комплекте);

Stream Labs WaveServer A54 - предназначен для автоматизации проезда через пропускной пункт. Идеология устройства “все в одном” на базе мощного процессора Stretch с применением быстродействующих алгоритмов распознавания позволит автоматизировать зону въезда/выезда без использования дополнительного оборудования.К устройству  подключаются две уличные аналоговые камеры, с   помощью которых осуществляется захват изображения для въезда и выезда, а   также кабель для соединения с кнопкой включения исполнительного   механизма на открытие. Сервер оцифровывает изображения с камер, осуществляет распознавание   автомобильного номера и сверяет его с базой номеров, находящейся внутри   устройства. Если номер находиться в “белом” списке, исполнительному   механизму поступает команда на открытие. Устройство осуществляет   хранение всех распознанных номеров, изображений номеров и фотографий   въезжающих в зону автомобилей. WaveServer А54 работает в автономном   режиме или в on-line режиме по Ethernet.Гибкость встроенных алгоритмов в WaveServer А54 позволяет распознавать   номера автомобилей в разное время суток и при любых погодных условиях.   Хранение номеров автомобилей во встроенной базе данных помогает в   подготовке регулярных отчетов о проезде автотранспорта. Особенности и преимущества  Контроль зоны въезда-выезда;
Захват и идентификация номера автомобиля. Команда на открытие в случае автомобиля из “белого” списка;
Встроенная SD-карта для хранения номеров и изображений;
Встроенные часы для фиксации времени проезда;
Автономная работа без ПК и возможность установки в неотапливаемый шкаф шлагбаума;
Российские и европейские шаблоны автономеров;
Связь с поcтом охраны по Ethernet;
ПО для мониторинга за зоной въезда-выезда;
Полнодуплексная передача звука;
Питание PoE или 12V;
Режим день-ночь;
Небольшой габаритный размер;
Простота инсталляции.
Возможность интеграции с внешними "большими" системами управления въездомвыездом.ПрименениеГородские дворы;
Крупные логистические центры; 
Парковки; 
КПП; 
Гаражи; 
Склады; 
Коттеджные поселки и садовые товарищества.Управление зоной въездавыезда по радиоканалу - преимущества решения на базе А54Прямой конкурент предлагаемого нами решения на массовом рынке это системы управления шлагбаумом через радиоканал с брелка. Это достаточно распространенное решение и оно действительно   просто в установке, использовании и обслуживании. Но при этом в этом   решении есть и масса минусов:При количестве пользователей системой от 40 человек она   банальна становиться дороже. Стоимость одного брелка сейчас от 1500   руб.!
Брелок можно потерять - покупка нового. 
Брелок можно забыть - неудобство. В нем может сесть батарейка!
К вам едут гости - нужно идти встречать их. А если это большой СНТ на 150 домов?!
Брелок могут украсть и потом несанкционированно проехать на территорию.
Стрелу шлагбаума несложно "приподнять", проехать и потом   "опустить" обратно. Т.е. к этой системе желательна уличная видеокамера   наблюдения! А значит еще либо DVR, либо компьютер с установкой их в   отапливаемом помещении. Стоимость решения возрастает и усложняется!
Ну и наконец проблема организации круглосуточного и   беспрепятственного проезда на территорию транспортных средств   правоохранительных органов, скорой медицинской помощи и т.д. и т.п.Законодательная базаВ соответствии со ст.16 Федерального Закона от 29.12.2004 №   189-ФЗ «О введении в действие Жилищного кодекса Российской Федерации» с   момента формирования земельного участка и проведения его   государственного кадастрового учета земельный участок, на котором   расположены многоквартирный дом и иные входящие в состав такого дома   объекты недвижимого имущества, переходит бесплатно в общую долевую   собственность собственников помещений в многоквартирном доме. Надлежащим образом оформленное право на землю позволяет жильцам   дома защищать свои права на придомовую территорию и элементы   благоустройства, не допускать использования этой территории посторонними   лицами для парковки автомобильного транспорта, организации торговли и   т.п.Установка ограждений на придомовых территориях в городе Москве   осуществляется на основании требований постановления Правительства   Москвы  от 2 июля 2013 г. N 428-ПП «О ПОРЯДКЕ УСТАНОВКИ ОГРАЖДЕНИЙ НА   ПРИДОМОВЫХ ТЕРРИТОРИЯХ В ГОРОДЕ МОСКВЕ».В указанном постановлении под ограждениями понимаются устройства   регулирования въезда и (или) выезда на придомовую территорию   транспортных средств.ОДНАКО! В случае установки и последующей эксплуатации ограждающих   устройств собственники помещений в многоквартирном доме обеспечивают   круглосуточный и беспрепятственный проезд на придомовую территорию   пожарной техники, транспортных средств правоохранительных органов,   скорой медицинской помощи и т.д. и т.п.Таким образом устройство управляющее шлагбаумом должно   автоматически распознавать номера соответствующих служб и впускать их на   придомовую территорию. Решение с управлением через радиопульт в данном   случае пригодно только при наличии постоянного охранника  консьержа.Технические характеристики Stream Labs WaveServer A54Алгоритм сжатия - H.264, MJPEGРазрешение - PAL: 768х576, 704x544, 384x288, 352x272, 192x144, 176x136, NTSC: 640х480, 320х240, 160x120Частота кадров - 50 кадров/с ,25 кадров на каналПараметры изображения - 20 уровней сжатия, Ориентация изображения: 0, 180°, Настройка яркости, контраста, насыщенности и цветности, Деинтерлейсинг Звук - Аудио вход и аудио выход: PCM, 16 кГц, 16 битБезопасность - Защищенные паролем уровни доступа пользователейТревожное оповещение и управление событиями - Внешние I/OРазъемы - 2 аналоговых композитных BNC разъема, Разъем RJ45 для подключения Ethernet, Блок клемм Alarm I/O (2 тревожных входа, 2 релейных выхода), Разъем Jack 3,5мм линейного выхода, микрофона или линейного входа, Блок клемм RS485 для управления поворотными устройствами, Разъем для подключения электропитанияСетевой интерфейс - Ethernet 10BASE-T/100BASE-TXКарта памяти - Secure Digital Memory Card (SD) 16GbЭлектропитание - Power over Ethernet ,12-48 ВЭнергопотребление - 5 Вт постоянного токаУсловия эксплуатации - 0°C ~ +50°C, влажность 20 – 80% (без выпадения конденсата)Процессор - Процессор: Stretch 7110Доступ через WEB-браузер - Просмотр живого видео, изменение сетевых настроек, настройка параметров изображенияМинимальные требования к оборудованию - Pentium 4 CPU от 1300 MHz или аналогичный процессор AMD 256 MB RAM, Графическая карта, Direct Draw, 64 MB RAM, Windows XP, Server 2003, DirectX 9.0 и выше, Internet Explorer 6.0 и выше.Поддерживаемые протоколы - IPv4, IPv6, TCP, UDP, HTTP, HTTPS, SMTP, DHCP, DNS , RTP/RTCP, RTSPРазмеры (ДхШхВ), вес - 115x82x32 мм, 200 гПрезентация Stream Labs WaveServer A54Параметры Stream Labs WaveServer A54
